render(){

	return(
    <div className='ma2 mt0 flex ma2 '>
      <div className='center flex flex-column'>
      	<div className="ph3">
  			<a className="f3 link dim br3 ph3 ma2 pv2 mb2 dib white bg-black"
  			onClick={this.onStartQuiz} >Binary</a>
  			<a className="f3 link dim br3 ph3 pv2 mb2 dib white bg-black bg-white"
