  			<br />
  			<a className="f3 link dim br3 ph3 pv2 mb2 dib white bg-black"
  			onClick={this.onStartQuiz} >Start Quiz</a>
  		</div>
      </div>
    </div>

);
}

}

export  default QuizCreate;
